31	Артем	+79031273893	artsolxeh@gmail.com	Брал в прокат Ситроен Берлинго в сентябре 2021 года. Машину пригнали во время, с полным баком, всё дали посмотреть, всё показали, отметили мои замечания в акте, подписали договор. Машина хорошая вместительная, удобная посадка. Двигателя достаточно чтобы не тормозить в потоке имея полный салон (4 чел.) и багажник. Расход составил 6,5-8 л/100 км, при средней скорости в городе 50, по трассе 100. Когда катались было ветрено и на открытых участках это хорошо ощущается, поэтому будьте осторожны. Машина высокая, есть парусность. Сдал машину быстро и без проблем. Сдавал в Зеленоградске. Спасибо Амиго за оперативность и хорошую обратную связь.	t	5	10	2021-09-27 15:14:24.187946	2021-09-28 14:52:21.072404
