or a period of less than 1 day. Come in and compare prices.	<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Hull insurance is a type of insurance of vehicles against damage or other risks associated with using it. With regard to car insurance, this includes covering the risks associated with causing damage to the car, even through the fault of the vehicle owner. For a car rental client, the presence of hull insurance on a rented car means that he will not be fully liable even if he has an accident due to his own fault or, in the event of a car theft, will not reimburse its full cost.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;When insuring a car under Hull insurance, a franchise&nbsp; is provided. A franchise is a fixed amount established by a car insurance contract that the insurance company does not reimburse if the car is damaged. Therefore, the car rental agreement established that this part of the damage, which is not refundable by the insurance company, is compensated by the lessee, that is, the car rental client.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;This norm also has another legal and economic meaning: the tenant bears part of the responsibility for a car damaged through his fault so that he would be more careful about the vehicle provided to him for temporary possession. For the client, this is still much more profitable than concluding a lease agreement with the full responsibility of the tenant. (You can read more about this in our article about Hull insurance)</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Usually, for economy and middle class cars, the franchise is 5-15 thousand rubles. 20,000 - 50,000 rubles or more for business and premium cars, and for exclusive cars can range from several hundred thousand to several million rubles.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Nevertheless, since Amigo car rental seeks to maximize customer satisfaction, it is possible to completely protect the tenant from any risks associated with the operation of the car, even those that do not cover the standard hull insurance policy, by connecting the option &quot;Full warranty&quot;. For a small surcharge, you can guarantee yourself protection in any situations. Read more about the Full Warranty option <a href="/en/full-insurance">here</a>.</p>\r\n	Car rent, car hire in Kaliningrad with hull insurance	✅ All cars are insured under hull in Amigo car rental - this is the minimum responsibility of the client, and the "Full Guarantee" protects against all possible risks.	<p>&nbsp;To rent a car, a representative of the organization must provide:</p>\r\n\r\n<p>- passport</p>\r\n\r\n<p>- driver&#39;s license</p>\r\n\r\n<p>- a power of attorney from the organization for the right to receive a car (or have the right to sign and seal)</p>\r\n\r\n<p>Any form of payment is available:</p>\r\n\r\n<p>- non-cash form of payment</p>\r\n\r\n<p>- payment by corporate bank card</p>\r\n\r\n<p>- cash, with the provision of all necessary documents for reporting established by law</p>\r\n\r\n<p>For an organization, renting a car carries a number of advantages compared to purchasing a car; you can&nbsp; watch these advantages in the information about <a href="/en/transportnyi-autsorsing">transport outsourcing</a>.</p>\r\n\r\n<p>When concluding a lease for more than one month, our company is ready to provide you with personal terms for renting a car.</p>\r\n\r\n<p>When concluding a lease for a period of more than six months, we are ready to purchase the car you are interested in, in the absence of a similar model in our <a href="/en/cars">car park</a>.</p>\r\n	Car hiring for corporate clients in Amigo car rental	✅ Advantageous car rental offers in Kaliningrad and the Kaliningrad region for organizations from Amigo car rental. Check out the terms.	<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;All relations between Amigo and a client are based on the principle: &l